import axios, { AxiosError } from 'axios';


export async function newMsg(massage){
    try{
        console.log('oooo')
        const newMassage = await axios.post(`http://localhost:3030/api/message`,massage)
        return newMassage.data.data
    }catch(err){

    }
}
